Mendefinisikan RequestInterfaceMethod
Memahami untuk InterfaceEndpoint API seperti contoh script diberikut :
public interface EndpointInterface {
    // Request method and URL specified in the annotation
    // Callback for the parsed response is the last parameter

    @GET("users/{username}")
    Call getUser(@Path("username") String username);

    @GET("group/{id}/users")
    Call> groupList(@Path("id") int groupId, @Query("sort") String sort);

    @POST("users/new")
    Call createUser(@Body User user);
}

dari contoh script diatas ada beberapa Annotasi yang penting di ketahui, sebagai berikut :



Annotation
Description




@Path
variable substitution for the API endpoint (i.e. username will be swapped for{username}in the URL endpoint).


@Query
specifies the query key name with the value of the annotated parameter.


@Body
payload for the POST call (serialized from a Java object to a JSON string)


@Header
specifies the header with the value of the annotated parameter



